import SocialMediaIcons from "./SocialMediaIcons";


const Footer =()=>
{
    return (
			<footer className='h-46 bg-siniy pt-10'>
				<div className='w-5/6 mx-auto'>
					<SocialMediaIcons />
					<div className="md:flex justify-center md:justify-between text-center">
						<p className=" font-playfair font-semibold text-2xl text-yellow">SWINEHERD</p>
						<p>©2024 SWINEHERD. ВСЕ ПРАВА НЕЗАЩИЩЕНЫ</p>
					</div>
				</div>
			</footer>
		)
}

export default Footer;
